import React from "react";

function AboutUs() {
  return (
    <div style={{ padding: "20px" }}>
      <h2>About Us</h2>
      <p>
        Welcome to the Mini Volunteering App! Our mission is to connect
        volunteers with meaningful activities and help communities thrive.
      </p>
      <p>
        You can browse, add, and manage volunteering activities. Join us to
        make a difference!
      </p>
    </div>
  );
}

export default AboutUs;
